import React, {Component} from 'react';
import { List } from '@material-ui/core';
import BookItem from './BookItem'; 

class BookL extends Component {
    render() {
        const bookItem = this.props.books.map(book => {
               return (
                   <BookItem 
                    book = { book }
                    key = { book.ISBN }
                    />
               ) 
        }) 
        return (
            { bookItem }
        ) 
    }
}

export default BookL;
